import React from 'react';
import makeStyles from "@material-ui/core/styles/makeStyles";
import Iframe from "react-iframe";
import Grid from "@material-ui/core/Grid";
import Divider from "@material-ui/core/Divider";
import Card from "@material-ui/core/Card";
import orange from "@material-ui/core/colors/orange";
import amber from "@material-ui/core/colors/amber";

const useStyles = makeStyles(theme => ({
    content: {
        fontSize: 18,
        fontFamily: "Garamond"
    },
    divider: {
        marginTop: 10,
    },
    desc_card: {
        minHeight: 100,
        background: orange[50]
    },
    anec_card: {
        minHeight: 100,
        background: amber[200]
    },
    grid_text: {
        padding: 20
    }
}));

export default function Guitar() {
    const classes = useStyles();
    return (
        <div>
            <Grid container justify="space-evenly">
                <Grid item xs={5}>
                    <Iframe url="https://www.youtube.com/embed/bwVirkXOSz4"
                            id="Guitar_vid1"
                            display="initial"
                            height="300px"
                            allowFullScreen
                    />
                </Grid>
                <Grid item xs={5}>
                    <Iframe url="https://www.youtube.com/embed/shiSCyZfQlU"
                            id="Guitar_vid2"
                            display="initial"
                            height="300px"
                            allowFullScreen
                    />
                </Grid>
            </Grid>

            <Divider className={classes.divider} variant="middle"/>

            <Grid className={classes.grid_text} container justify="space-evenly" spacing={3}>
                <Grid item xs={7}>
                    <Card raised className={classes.desc_card}>
                        <ul className={classes.content}>
                            <li> Learnt for 5 years.</li>
                            <li> Also did this</li>
                            <li> And that</li>
                        </ul>
                    </Card>
                </Grid>
                <Grid item xs={5}>
                    <Card raised className={classes.anec_card}>
